package com.chinasofti.db;

import java.io.IOException;
import java.security.SecureRandom;

import javax.crypto.Cipher;
import javax.crypto.KeyGenerator;
import javax.crypto.SecretKey;
import javax.crypto.spec.SecretKeySpec;

public class AESUtil {
	/** 
     * 加密 
     *  
     * @param content 需要加密的内容 
     * @param password  加密密码 
     * @return 
     */  
    public static byte[] encrypt(String content, String password) {  
            try {             
                KeyGenerator kgen = KeyGenerator.getInstance("AES");  
                kgen.init(128, new SecureRandom(password.getBytes()));  
                SecretKey secretKey = kgen.generateKey();  
                byte[] enCodeFormat = secretKey.getEncoded();  
                SecretKeySpec key = new SecretKeySpec(enCodeFormat, "AES");  
                Cipher cipher = Cipher.getInstance("AES");// 创建密码器  
                byte[] byteContent = content.getBytes("utf-8");  
                cipher.init(Cipher.ENCRYPT_MODE, key);// 初始化  
                byte[] result = cipher.doFinal(byteContent);  
                return result; // 加密  
            }catch (Exception e) {  
                e.printStackTrace();  
            }  
            return null;  
    }  
    
    
    
    /**解密 
     * @param hexStr  待解密内容 
     * @param password 解密密钥 
     * @return 
     */  
    public static String decryptStr(String hexStr, String password) {  
            try { 
            	if (hexStr.length() < 1)  
                     return null;  
            	byte[] content = new byte[hexStr.length()/2];  
             	for (int i = 0;i< hexStr.length()/2; i++) {  
                     int high = Integer.parseInt(hexStr.substring(i*2, i*2+1), 16);  
                     int low = Integer.parseInt(hexStr.substring(i*2+1, i*2+2), 16);  
                     content[i] = (byte) (high * 16 + low);  
             	}  
             	
                KeyGenerator kgen = KeyGenerator.getInstance("AES");  
                kgen.init(128, new SecureRandom(password.getBytes()));  
                SecretKey secretKey = kgen.generateKey();  
                byte[] enCodeFormat = secretKey.getEncoded();  
                SecretKeySpec key = new SecretKeySpec(enCodeFormat, "AES");              
                Cipher cipher = Cipher.getInstance("AES");// 创建密码器  
                cipher.init(Cipher.DECRYPT_MODE, key);// 初始化  
                byte[] buf = cipher.doFinal(content);  
                return new String(buf,"UTF-8");
                
            }catch (Exception e) {  
                e.printStackTrace();  
            }  
            return null;  
    }  
    /**将二进制转换成16进制 
     * @param buf 
     * @return 
     */  
    public static String parseByte2HexStr(byte buf[]) {  
            StringBuffer sb = new StringBuffer();  
            for (int i = 0; i < buf.length; i++) {  
                    String hex = Integer.toHexString(buf[i] & 0xFF);  
                    if (hex.length() == 1) {  
                            hex = '0' + hex;  
                    }  
                    sb.append(hex.toUpperCase());  
            }  
            return sb.toString();  
    }  
    
    /**将16进制转换为二进制 
     * @param hexStr 
     * @return 
     */  
    public static byte[] parseHexStr2Byte(String hexStr) {  
            if (hexStr.length() < 1)  
                    return null;  
            byte[] result = new byte[hexStr.length()/2];  
            for (int i = 0;i< hexStr.length()/2; i++) {  
                    int high = Integer.parseInt(hexStr.substring(i*2, i*2+1), 16);  
                    int low = Integer.parseInt(hexStr.substring(i*2+1, i*2+2), 16);  
                    result[i] = (byte) (high * 16 + low);  
            }  
            return result;  
    }  
    
    public static void main(String[] args) throws IOException{
    	String s = "";
    	String s2 = decryptStr(s,"661435B765F83D3D39AF5F8C13290036");
    	String s3 = ZipUtil.uncompress(s2);
    	System.out.println(s3);
    	//System.out.println(s2);
    }
}
